import Carosello from './Carosello'; 
function Home() {
    return (
      <>
        <section className="welcome-section">
          <h1>Benvenuto nel mio sito</h1>
          <p>Qui troverai informazioni sulla mia tesi "Decodificare gli Stereotipi: L'Impatto delle Intelligenze Artificiali sui Messaggi Pubblicitari".</p>
        </section>
        <section className="carousel-section">
          <Carosello />
        </section>
      </>
    );
  }
  export default Home;
